import './styles.css';


const GithubSearch = () => {
    return (
        <div className="github-search-container">
            <div className="github-search-card">
                <h1>Encontre um perfil Github</h1>
                <input type="text" />
                <button className='btn '>Encontrar</button>
            </div>
        </div>
    )
}

export default GithubSearch;
